import Header from '../Header'

function Contact() {

    const [carBrand, setCarBrand] = useState("BMW");
    const [color, setColor] = useState("silver");
    const [year, setYear] = useState(2009)


    const updateCarBrand = (e) => {
        setCarBrand(e.target.value)
    }
    const updateColor = (e) => {
        setColor(e.target.value)
    }
    const updateYear = (e) => {
        setYear(e.target.value)
    }

        return(
            <div>
                <Header />
                This is Contact

<p>Brand: <input style={{width: '150px', height: '30px', border: "1px solid green" }} onChange = {updateCarBrand}/>  {carBrand}</p>
<p><input style={{width: '150px', height: '30px', border: "1px solid green" }} onChange = {updateCarBrand}onChange = {updateColor}/>  {color}</p>
<p><input style={{width: '150px', height: '30px', border: "1px solid green" }} onChange = {updateCarBrand}onChange = {updateYear}/> Year: {year}</p>

            </div>
        )
    }

export default Contact
